import Axios from "axios";
import React, { useState } from "react";
import { Link, resolvePath } from "react-router-dom";

export default function Login() {
    const [name, setName] = useState("");
    const [password, setPassword] = useState("");

    const auth = (name, password) => {
        Axios.post("http://localhost:3001/auth", {
            name: name,
            password: password,
        }).then((response) => {
            if(response.data == "ok"){
                console.log("logat in client");
            }
            else{
                console.log("nelogat in client");
            }
        }).catch((error) => {
            console.log(error)
        });
    };


    const Login = () => {
        const [username, setUsername] = useState('');
        const [password, setPassword] = useState('');
      
        const handleLogin = () => {
          const credentials = {
            username: username,
            password: password
          };
      
          Axios.post('http://localhost:3001/auth', credentials)
            .then(response => {
              if (response.status === 200) {
                console.log('Autentificare reușită!');
                // Executați acțiuni corespunzătoare pentru autentificarea reușită
              } else {
                console.log('Autentificare eșuată!');
                // Executați acțiuni corespunzătoare pentru autentificarea eșuată
              }
            })
            .catch(error => {
              console.error('Eroare:', error);
            });
        };
    }
      



    return (
        <div className="loginDiv">
            <div className="formLogin">
                <h4>Login</h4>
                <form>
                    <div className="input-container">
                        <label>Username </label>
                        <input
                            type="text"
                            name="uname"
                            onChange={(e) => setName(e.target.value)}
                            required
                        />
                    </div>
                    <div className="input-container">
                        <label>Password </label>
                        <input
                            type="password"
                            name="pass"
                            onChange={(e) => setPassword(e.target.value)}
                            required
                        />
                    </div>
                    <div className="button-container">
                        <button type="button" onClick={Login.handleLogin}>
                            Aaaaa
                        </button>
                    </div>
                </form>
            </div>
        </div>
    );
}
